import React, { Component } from "react";
class app extends Component {
    constructor() {
        super()
     


    }
    clicHanler() {
        this.setState(x => {
            return { nunber: x.nunber + 5 }
        })

    }



    render() {
        return (
            <div>
                <h1>{this.state.nunber} </h1>
                <button onClick={this.clicHanler} > Clic Me</button>
            </div>
        )
    }
}

export default app;
